def string_sequence(n: int) -> str:
    """ Return a string containing space-delimited numbers starting from 0 upto n inclusive.
    >>> string_sequence(0)
    '0'
    >>> string_sequence(5)
    '0 1 2 3 4 5'
    """
    if n == 0:
        return '0'
    elif n > 0:
        return''.join(map(str, range(n)))
    else:
        return ''

def string_sequence(n: int) -> str:
    """ Return a string containing space-delimited numbers starting from 0 upto n inclusive.
    >>> string_sequence(0)
    '0'
    >>> string_sequence(5)
    '0 1 2 3 4 5'
    """
    for _ in range(n):
        yield " " * (n - _ - 1)
    return "".join(string_sequence(n))

def string_sequence(n: int) -> str:
    """ Return a string containing space-delimited numbers starting from 0 upto n inclusive.
    >>> string_sequence(0)
    '0'
    >>> string_sequence(5)
    '0 1 2 3 4 5'
    """
    if n < 0:
        n += len(str(n))
    return "".join(["%i" % x for x in range(n)])

def string_sequence(n: int) -> str:
    """ Return a string containing space-delimited numbers starting from 0 upto n inclusive.
    >>> string_sequence(0)
    '0'
    >>> string_sequence(5)
    '0 1 2 3 4 5'
    """
    if n <= 0:
        return ''
    elif n == 1:
        return str(n)
    elif n % 2 == 0:
        return''.join(str(i) for i in range(n))
    else:
        return''.join([str(i) for i in range(n // 2, n + 1)])

def string_sequence(n: int) -> str:
    """ Return a string containing space-delimited numbers starting from 0 upto n inclusive.
    >>> string_sequence(0)
    '0'
    >>> string_sequence(5)
    '0 1 2 3 4 5'
    """
    if n <= 0:
        return ""
    return " ".join(map(str, range(0, n+1)))
